import React from "react";
import Slider from "./slider";
import SidebarItem from "./sidebarItem";
function photoApp() {
  return (
    <div className="container">
      <div className="image"></div>
      <div className="sidebar">
        <SidebarItem></SidebarItem>
      </div>
      <Slider />
    </div>
  );
}

export default photoApp;
